import { contaxtApi } from './CopmA'

function CompC() {

    return (
        <div>
            <contaxtApi.Consumer>
                {(items) => {
                    console.log(items[0]);
                    return <table>
                        <thead>
                            <tr>
                                <th>Name</th>
                                <th>Age</th>
                                <th>Action</th>
                            </tr>
                        </thead>
                        <tbody>
                            {items[0].map((item) => {
                                return <tr key={item.id}>
                                    <td>{item.name}</td>
                                    <td>{item.age}</td>
                                    <td>
                                        <button onClick={() => items[1](item.id)}>remove</button>
                                    </td>
                                </tr>
                            })}

                        </tbody>
                    </table>
                }}

            </contaxtApi.Consumer>
        </div>
    )
}
export default CompC
